    const [content,setContent]=useState(<button onClick={clickHandler}>Add New Expense</button>)

    const clickHandler=()=>{
        setContent(
            <ExpenseForm getNewExpense></ExpenseForm>
        )
    }

    return (
        <div className="new-expense">
            {content}
        </div>
    )

}

